def count_combinations(n: int, s: int) -> int:
    """"""
    dp = [[0 for _ in range(1001)] for _ in range(10)]
    dp[0][0] = 1
    for now in range(1, 101):
        for used in range(9, 0, -1):
            dpu = dp[used]
            dpu_1 = dp[used - 1]
            for s_val in range(now, 1001):
                dpu[s_val] = dpu_1[s_val - now] + dpu[s_val]
    return dp[n][s]
